import React from 'react'
class CyberExposureScore extends React.Component{
    constructor(props){
        super()
    }
render(){

    return(
        <div className="ces">
            <div className="ces1">
                <p> Cyber Exposure Score</p>
            </div>
            <div className="ces2">
                <p><small>
                Companies are given exposure score based on identified risk
                divided by employee count on last 12 months. Score ranges from 0
                to 300+.Companies with no exposure during the past 12 months have score 0.
                Companies that have score 300+ represent the top 10% most exposed Companies.
                </small>
                    
                </p>
            </div>
            <div className="ces3">
                <div className="ces31">
                    <h1> <bold> 169</bold></h1>
                </div>
                <div className="ces32">
                    <p>/30</p>
                    <p>/300</p>
                </div>
                

            </div>

            <div className="ces4">

            </div>
        
        <style jsx>{`
        .ces{
            display:flex;
            flex-direction:column;
            justify-content:space-around;
            margin-left:5%;
            height:100%;
            width:90%;
        }
        .ces1{
            display:flex;
            align-items:center;
            justify-content:center;
            background:blue;
            font-size:20px;
            height:10%;
        }
        .ces2{
            display:flex;
            align-items:center;
            justify-content:center;
            background:blue;
            height:20%;
        }
        .ces3{
            display:flex;
            flex-direction:row;
            background:blue;
            height:30%;
        }
        .ces31{
            display:flex;
            height:100%;
        }
        .ces4{
            background:blue;
            height:20%;
        }
        
        `}


        </style>
        
        </div>
    )

}

}
export default CyberExposureScore;
